import React from "react";

import {storage} from '../firebase';
import {Map, InfoWindow, Marker, GoogleApiWrapper} from 'google-maps-react';
const GeoFire = require('geofire').GeoFire;


const style = {
		  width: '50%',
		  height: '50%'
}

var firebaseRef = storage.ref("locations");
var geoFire = new GeoFire(firebaseRef);


geoFire.set("users", [34.052235, -118.243683])
	.then(function() {
		console.log("Location added")
	}).catch(function(error) {
	console.log(error);
});

export class MapQuery extends React.Component {
  render() {
    return (
      <Map google={this.props.google} zoom={14} style={style}>
 
    
      </Map>
    );
  }
}



export default GoogleApiWrapper({
  apiKey: "AIzaSyC5g7d4aY3U9JJdYFyS6mDUHLCWmQspZt4"
})(MapQuery)
